import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import HomePage from "./pages/HomePage";
import LoginPage from "./pages/LoginPage";
import AdminLoginPage from "./pages/AdminLoginPage";
import AdminDashboard from "./pages/AdminDashboard";
import SignupPage from "./pages/SignupPage";
import FlightSearch from "./pages/FlightSearch";
import BrowseFlights from "./pages/admin/BrowseFlights"; // New import
import BrowseCrews from "./pages/admin/BrowseCrews"; // New import
import BrowseAircrafts from "./pages/admin/BrowseAircrafts"; // New import
import ManageCrew from "./pages/admin/ManageCrew"; // New import
import ManageAircraft from "./pages/admin/ManageAircraft"; // New import
import ManageDestinations from "./pages/admin/ManageDestinations"; // New import
import ModifyFlights from "./pages/admin/ModifyFlights"; // New import
import PrintUsers from "./pages/admin/PrintUsers"; // New import
import "bootstrap/dist/css/bootstrap.min.css";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/login" element={<LoginPage />} />
        <Route path="/admin-login" element={<AdminLoginPage />} />
        <Route path="/admin-dashboard" element={<AdminDashboard />} />
        <Route path="/signup" element={<SignupPage />} />
        <Route path="/flight-search" element={<FlightSearch />} />
        {/* New routes for admin functionalities */}
        <Route path="/admin/browse-flights" element={<BrowseFlights />} />
        <Route path="/admin/browse-crews" element={<BrowseCrews />} />
        <Route path="/admin/browse-aircrafts" element={<BrowseAircrafts />} />
        <Route path="/admin/manage-crew" element={<ManageCrew />} />
        <Route path="/admin/manage-aircraft" element={<ManageAircraft />} />
        <Route
          path="/admin/manage-destinations"
          element={<ManageDestinations />}
        />
        <Route path="/admin/modify-flights" element={<ModifyFlights />} />
        <Route path="/admin/print-users" element={<PrintUsers />} />
      </Routes>
    </Router>
  );
}

export default App;
